import React from 'react';
import './Keyboard.css';

class Keyboard extends React {
	render(){
		return(
			<table className="tableKeyboard">
		<tr>
			<button defaultValue="1">1</button>
			<button>2</button>
			<button>3</button>
		</tr>
		<tr>
			<button>4</button>
			<button>5</button>
			<button>6</button>
		</tr>
		<tr>
			<button>7</button>
			<button>8</button>
			<button>9</button>
		</tr>
		<tr id="buttonRow">
			<button className="buttonClear">Delete</button>
		</tr>
	</table>
		);
	}
}

export default Keyboard;
